// import logo from './logo.svg';
import './App.css';
import Home from './components/Home/Home';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import SignUp from './components/Contact/SignUp';
import Page1 from "./Page/Page1";
import Page2 from "./Page/Page2";
import Page3 from "./Page/Page3";
// import SignUp from '../Contact/SignUp'
import Contact from "../Contact/Contact";
// import LoginPage from './components/Contact/LoginPage/LoginPage';

function App() {
  return (
    <div>
      <Home/>
      <BrowserRouter>
        <Routes>
          <Route path="./Page1.js" element={<Page1 />}>
            <Route path="./Page2.js" element={<Page2 />} />
            <Route path="./components/Home/Page/Page3.js" element={<Page3 />} />
            <Route path="./components/Contact/Contact.js" element={<Contact />} />
            <Route path="./components/Contact/SignUp.js" element={<SignUp />} />

          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
